import React, { useState, useEffect } from 'react';

const phrases = [
  'amazing user interfaces',
  'meaningful user experiences',
  'creative website design',
];

function Tagline() {
  return (
    <div>
      <h1 className="tagline">
        an interdisciplinary designer
        <br />
        focused on creating
        <br />
        meaningful user experiences
      </h1>
    </div>
  );
}

export default function Home() {
  return (
    <div>
        <Tagline/>
    </div>

  );
}
